// src/pages/ClientDashboard.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../styles/Dashboard.css';

const ClientDashboard = () => {
  const [drugs, setDrugs] = useState([]);

  useEffect(() => {
    // Fetch drugs from API (mock data for now)
    setDrugs([{ id: 1, name: 'Paracetamol' }, { id: 2, name: 'Ibuprofen' }]);
  }, []);

  return (
    <div className="dashboard-container">
      <header className="logo-bar">
        <img src="/path/to/logo.png" alt="Logo" className="logo" />
        <h1>Client Dashboard</h1>
      </header>

      <div className="main-content">
        <nav className="sidebar">
          <ul>
            <li><Link to="/client/home">Home</Link></li>
            <li><Link to="/client/drugs">Drugs</Link></li>
            <li><Link to="/client/profile">Profile</Link></li>
            <li><Link to="/client/logout">Logout</Link></li>
          </ul>
        </nav>

        <div className="content">
          <h2>Available Drugs</h2>
          <ul>
            {drugs.map((drug) => (
              <li key={drug.id}>{drug.name}</li>
            ))}
          </ul>
          <Link to="/client/book" className="book-link">Book a Drug</Link>
        </div>
      </div>
    </div>
  );
};

export default ClientDashboard;
